import Particles from 'react-particles-js';

const Galaxy = () => (
	<Particles
		params={{
			"particles": {
				"number": {
					"value": 600,
					"density": {
						"enable": true,
						"value_area": 789.1476416322727
					}
				},
				"color": {
					"value": "#ffffff"
				},
				"shape": {
					"type": "circle",
					"stroke": {
						"width": 0,
						"color": "#000000"
					},
					"polygon": {
						"nb_sides": 5
					},
					"image": {
						"src": "img/github.svg",
						"width": 100,
						"height": 100
					}
				},
				"opacity": {
					"value": 0.5,
					"random": false,
					"anim": {
						"enable": true,
						"speed": 0.2,
						"opacity_min": 0,
						"sync": false
					}
				},
				"size": {
					"value": 1.6,
					"random": true,
					"anim": {
						"enable": true,
						"speed": 3,
						"size_min": 0,
						"sync": false
					}
				},
				"line_linked": {
					"enable": false,
				},
				"move": {
					"enable": true,
					"speed": .5,
					"direction": "none",
					"random": true,
					"straight": false,
					"out_mode": "out",
					"bounce": false,
					"attract": {
						"enable": false,
						"rotateX": 600,
						"rotateY": 1200
					}
				}
			},
			"interactivity": {
				"detect_on": "canvas",
				"events": {
					"onhover": {
						"enable": false,
						"mode": "bubble"
					},
					"onclick": {
						"enable": false,
						"mode": "push"
					},
					"resize": true
				},
				"modes": {
					"grab": {
						"distance": 400,
						"line_linked": {
							"opacity": 1
						}
					},
					"bubble": {
						"distance": 83.91608391608392,
						"size": 1,
						"duration": 3,
						"opacity": 1,
						"speed": 3
					},
					"repulse": {
						"distance": 200,
						"duration": 0.4
					},
					"push": {
						"particles_nb": 4
					},
					"remove": {
						"particles_nb": 2
					}
				}
			},
			"retina_detect": true
		}} />
);

export default Galaxy;
